DROP TABLE IF EXISTS public.crm_customers;
DROP SEQUENCE IF EXISTS "crm_customers_id_seq";

BEGIN;

CREATE SEQUENCE IF NOT EXISTS "crm_customers_id_seq";
CREATE TABLE IF NOT EXISTS public.crm_customers (
	id bigint DEFAULT nextval('crm_customers_id_seq'::regclass) NOT NULL,
	license_number bigint DEFAULT 0 NOT NULL,
	"key" uuid DEFAULT uuid_generate_v4() NOT NULL,
	customer character varying(255),
	customer_type_id bigint DEFAULT 1 NOT NULL,
	address_id bigint DEFAULT 0 NOT NULL,
	city_id bigint DEFAULT 1130 NOT NULL,
	state_id bigint DEFAULT 2 NOT NULL,
	zipcode character varying(30),
	establishment_type_id bigint DEFAULT 0 NOT NULL,
	license_type_id bigint DEFAULT 0 NOT NULL,
	opens time without time zone DEFAULT '00:00:00'::time without time zone NOT NULL,
	closes time without time zone DEFAULT '00:00:00'::time without time zone NOT NULL,
	delivery_days json DEFAULT '{}'::json NOT NULL,
	notes json DEFAULT '{}'::json NOT NULL,
	created timestamp(6) without time zone DEFAULT now(),
	active boolean DEFAULT true NOT NULL,
	PRIMARY KEY(id)
);

COMMIT;

